import AppRouter from './Routes'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render( <
    React.StrictMode >
    <
    App / >
    <
    /React.StrictMode>
);

ReactDOM.render( <
    React.StrictMode >
    <
    AppRouter / >
    <
    /React.StrictMode>,
    document.getElementById('root')
);

